import React, {useState} from 'react';
import Usertable from '../component/userTable'
import Eventtable from '../component/eventTable'
import {userColumns} from '../data/Userdata';
import {eventColumns} from '../data/EventData';
import SideBarComponent from '../component/sideBarcomponent';

function Tablecontainer() {
    const [modelOpen, setModelOpen]=useState(false);
    const handleClickModelOpen=(data)=>{
        console.log(data);
        setModelOpen(true);
    }
    const handleClickModelClose=(data)=>{
        console.log(data);
        setModelOpen(false);
    }
    return (
        <React.Fragment>
            <Usertable columns={userColumns} title={'Event List'} openModelClick={handleClickModelOpen}/>
            <Eventtable columns={eventColumns} title={'User List'} openModelClick={handleClickModelOpen}/>
            <SideBarComponent 
                    modelOpen={modelOpen}                    
                    closeModelClick={handleClickModelClose}
            />
        </React.Fragment>

    );
}

export default Tablecontainer;
